import React from "react";
import styled from "styled-components";

const MemberBlock = styled.div`
  width: 150px;
  height: 150px;
  border: 10px solid black;
  border-radius: 1px;
  display: inline-block;
  margin-left: 10px;
  margin-top: 10px;
  background: #faf8f8;
`;

function MemberList({ key, id, name }) {
  return (
    <MemberBlock>
      {key}
      {id}
      {name}
    </MemberBlock>
  );
}

export default MemberList;
